    { name = "alembic" },
    { name = "alembic-postgresql-enum" },
    { name = "asyncpg" },
    { name = "authlib" },
    { name = "colorlog" },
    { name = "fastapi", extra = ["standard"] },
    { name = "fastapi-swagger" },
    { name = "gunicorn" },
    { name = "minio" },
    { name = "psycopg2-binary" },
    { name = "python-magic" },
    { name = "pyvips" },
    { name = "ruff" },
    { name = "sqlalchemy" },
    { name = "sqlalchemy-utils" },
    { name = "sqlmodel" },
]

[package.dev-dependencies]
dev = [
    { name = "pre-commit" },
    { name = "pytest" },
    { name = "pytest-async-sqlalchemy" },
    { name = "pytest-asyncio" },
    { name = "pytest-cov" },
]

[package.metadata]
requires-dist = [
    { name = "alembic", specifier = ">=1.17.0" },
    { name = "alembic-postgresql-enum", specifier = ">=1.8.0" },
    { name = "asyncpg", specifier = ">=0.30.0" },
    { name = "authlib", specifier = ">=1.6.5" },
    { name = "colorlog", specifier = ">=6.9.0" },
    { name = "fastapi", extras = ["standard"], specifier = ">=0.119.0" },
    { name = "fastapi-swagger", specifier = ">=0.3.35" },
    { name = "gunicorn", specifier = ">=23.0.0" },
    { name = "minio", specifier = ">=7.2.18" },
    { name = "psycopg2-binary", specifier = ">=2.9.11" },
    { name = "python-magic", specifier = ">=0.4.27" },
    { name = "pyvips", specifier = ">=3.0.0" },
    { name = "ruff", specifier = ">=0.15.0" },
    { name = "sqlalchemy", specifier = ">=2.0.44" },
    { name = "sqlalchemy-utils", specifier = ">=0.42.0" },
    { name = "sqlmodel", specifier = ">=0.0.27" },
]

[package.metadata.requires-dev]
dev = [
    { name = "pre-commit", specifier = ">=4.3.0" },
    { name = "pytest", specifier = ">=8.4.2" },
    { name = "pytest-async-sqlalchemy", specifier = ">=0.2.0" },
    { name = "pytest-asyncio", specifier = ">=1.2.0" },
    { name = "pytest-cov", specifier = ">=7.0.0" },
]
